description:
Energie in beeld helpt gemeenten
Energie in beeld is voor gemeenten en provincies met Enexis, Liander, Endinet of Stedin als netbeheerder. Met deze dienst houdt u gemakkelijk in de gaten hoe uw gemeente reageert op uw klimaatbeleid. U ziet direct of het beleid resultaten boekt, en zo ja, waar. Zo zorgen we samen voor een slim energieverbruik, in de hele gemeente. Door het verbruik te filteren op energiesoort, jaar of gebruiker (particulier of zakelijk), krijgt u een gedetailleerd inzicht in hoe de energie in uw gemeente verbruikt wordt. De netbeheerders vernieuwen de verbruiksgegevens 4 keer per jaar.
Uit deze dataset kunt u de volgende informatie halen per buurt in 2008:
    de hoeveelheid verbruikte energie inzien;
    de hoeveelheid opgewekte energie inzien;
    verhouding van particulier en zakelijk energieverbruik vergelijken;
    verbruik op provincie, gemeente, buurt en postcodegebied vergelijken;
    historische gegevens vanaf 2008 inzien;
